        id: 1,
        img: "https://upload.wikimedia.org/wikipedia/commons/thumb/5/50/User_icon-cp.svg/1200px-User_icon-cp.svg.png",
        followed: false,
        fullName: "Exo",
        status: "varavskoy",
        location: { city: "Erevan", country: "goshi bert" },
      },
      {
        id: 2,
        img: "https://upload.wikimedia.org/wikipedia/commons/thumb/5/50/User_icon-cp.svg/1200px-User_icon-cp.svg.png",
        followed: true,
        fullName: "Gonch",
        status: "varavskoy",
        location: { city: "Erevan", country: "goshi bert" },
      },
      {
        id: 3,
        img: "https://upload.wikimedia.org/wikipedia/commons/thumb/5/50/User_icon-cp.svg/1200px-User_icon-cp.svg.png",
        followed: false,
        fullName: "Ponch",
        status: "varavskoy",
        location: { city: "Erevan", country: "goshi bert" },
      },
    ]);
  }

  return (
    <div className={n.item}>
      {props.users.map((b) => {
        return (
          <div>
            <img src={b.img} />
            <p>{b.fullName}</p>
            <p>{b.status}</p>
            <p>{b.location.city}</p>
            <p>{b.location.country}</p>
            {b.followed ? (
              <button onClick={() => unfolow}>unfolow</button>
            ) : (
              <button>follow</button>
            )}
          </div>
        );
      })}
    </div>
  );
};

export default Users;
